vt:'<div><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><div style="margin-left:16px;display:block;text-align:left;"><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	On load of index.html , we populate DOM of index.html and initialize Captivate runtime by creating objects like : cp.movie, cp.EventManager, cp.ImageManager, cp.AudioManager, cp.VideoManager etc. and then start the timer with the interval defined by fps.</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span></div><div style="margin-left:0px;display:block;text-align:left;"><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style=""> 	On every enter frame callback, we load the current slide data falling in the current frame. </span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span></div><div style="margin-left:16px;display:block;text-align:left;"><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	After this, we parse all the children DOM elements of “div_Slide” div element and create JS Objects of cp.Frameset class and some specific class (cp.Shape, cp.TEB, cp.Autoshape, cp.DrawingItem etc.).</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	call start, updateFrame, reset on these objects based on the currentFrame and the timing of these objects.</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	handle audio-video seek on every enter frame callback.</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	handle pacing issues in this callback itself.</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span></div></div>',
