vt:'<div><div style="margin-left:0px;display:block;text-align:left;"><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	Interactivity of normal slides and hotspot slides is handled at the slide level. Every click event is handled by slide div and then the click handler parses all the slide items in the reverse z-order and invokes the success/failure handler of appropriate items.</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	Question slide/Result slide items are handled independently. Mouse event handlers are added at item level.</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	Mouse events for drag drop are handled at item level.</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">	Autoshape states are handled at item level.</span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><span style="">     </span></span><span class="cp-actualText" style="line-height:100%;color:#958f8d;font-size:20px;font-family:\'Trebuchet MS regular\',Trebuchet MS;"><br></span></div></div>',
